export default async function handler(e,o){const{DEXCOM_CLIENT_ID:n,DEXCOM_REDIRECT_URI:t,DEXCOM_BASE:c="https://sandbox-api.dexcom.com"}=process.env,s=`${c}/v2/oauth2/login?client_id=${encodeURIComponent(n)}&redirect_uri=${encodeURIComponent(t)}&response_type=code&scope=offline_access&state=${encodeURIComponent(e.query.state||"")}`;o.redirect(s)}